INSERT INTO `config_info` VALUES (43, 'cloud-common.yml', 'DEFAULT_GROUP', 'spring:\n  main:\n    allow-bean-definition-overriding: true\n  autoconfigure:\n    exclude: com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n\n#请求处理的超时时间\nribbon:\n  ReadTimeout: 10000\n  ConnectTimeout: 10000\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n  client:\n    config:\n      default:\n        connectTimeout: 10000\n        readTimeout: 10000\n  compression:\n    request:\n      enabled: true\n    response:\n      enabled: true\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n', 'c07e6f7321493f6d5390d0a08bffb75a', '2021-04-04 10:21:15', '2021-04-04 10:21:15', NULL, '172.18.0.1', '', '', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info` VALUES (44, 'cloud-common.properties', 'DEFAULT_GROUP', 'spring.main.allow-bean-definition-overriding=true\nspring.autoconfigure.exclude=com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n\n#请求处理的超时时间\nribbon.ReadTimeout=10000\nribbon.ConnectTimeout=10000\n\n# feign 配置\nfeign.sentinel.enabled=true\nfeign.okhttp.enabled=true\nfeign.httpclient.enabled=false\nfeign.client.config.default.connectTimeout=10000\nfeign.client.config.default.readTimeout=10000\nfeign.compression.request.enabled=true\nfeign.compression.response.enabled=true\n\n# 暴露监控端点\nmanagement.endpoints.web.exposure.include=\'*\'\n', 'b62774df756eb9570ee7960d0ae2e86b', '2021-04-04 10:24:36', '2021-04-04 10:29:15', NULL, '172.18.0.1', '', '0dca6ba7-f031-4cf6-a4e7-b44d0d036a47', '', '', '', 'properties', '');
