INSERT INTO `config_info` VALUES (52, 'cloud-gateway.properties', 'DEFAULT_GROUP', 'spring.cloud.gateway.discovery.locator.lowerCaseServiceId=true\nspring.cloud.gateway.discovery.locator.enabled=true\n      \n# 不校验白名单\nignore.whites=/auth/logout,/auth/login,/*/v2/api-docs,/csrf\n', '141244852bf27e125cbb9480406db317', '2021-04-04 10:54:49', '2021-04-04 10:54:49', NULL, '172.18.0.1', '', 'b8ffe849-49ed-452f-86df-273cfc8301dc', NULL, NULL, NULL, 'properties', NULL);

