INSERT INTO `his_config_info` VALUES (0, 26, 'cloud-common-mybatis-plus.properties', 'DEFAULT_GROUP', '', '# xml 扫描路径\r\nmybatis-plus.mapper-locations=classpath:/mapper/*Mapper.xml\r\n\r\n# MyBaits 别名包扫描路径，通过该属性可以给包中的类注册别名，注册后在 Mapper 对应的 XML 文件中可以直接使用类名，而不用使用全限定的类名(即 XML 中调用的时候不用包含包名)\r\nmybatis-plus.typeAliasesPackage=com.fank243.cloud.component.domain.entity\r\n\r\n# 枚举类 扫描路径，如果配置了该属性，会将路径下的枚举类进行注入，让实体类字段能够简单快捷的使用枚举属性\r\nmybatis-plus.typeEnumsPackage=com.fank243.cloud.component.domain.enums\r\n\r\n# # 全局默认主键类型，NONE：随机ID，默认值：ASSIGN_ID(雪花算法)\r\nmybatis-plus.global-config.db-configid-type=NONE\r\n\r\n# 表名前缀\r\nmybatis-plus.global-config.table-prefix=tb\r\n\r\n# 逻辑删除字段名称\r\nmybatis-plus.global-configlogic-delete-field=is_deleted \r\n\r\n # 字段验证策略之 insert,在 insert 的时候的字段验证策略\r\nmybatis-plus.global-configinsert-strategy=not_empty\r\n\r\n# 字段验证策略之 update,在 update 的时候的字段验证策略\r\nmybatis-plus.global-configupdate-strategy=not_empty \r\n\r\n# 开启Mybatis二级缓存，默认为 true\r\nmybatis-plus.configuration.cache-enabled=false\r\n', 'c832f393bc3ed731981c3b5dc6271a75', '2021-03-24 22:35:11', '2021-03-24 09:35:11', NULL, '172.18.0.1', 'I', '0dca6ba7-f031-4cf6-a4e7-b44d0d036a47');
