INSERT INTO `his_config_info` VALUES (0, 61, 'cloud-common-redis.properties', 'DEFAULT_GROUP', '', 'spring.redis.host=81.71.139.143\r\nspring.redis.port=8379\r\nspring.redis.password=antstar\r\nspring.redis.database=2', '09fb48559f357d81702b0f051793b450', '2021-04-04 23:54:49', '2021-04-04 10:54:49', NULL, '172.18.0.1', 'I', 'b8ffe849-49ed-452f-86df-273cfc8301dc');
INSERT INTO `his_config_info` VALUES (0, 62, 'cloud-common-mybatis-plus.properties', 'DEFAULT_GROUP', '', '# xml 扫描路径\r\nmybatis-plus.mapper-locations=classpath:/mapper/*Mapper.xml\r\n\r\n# MyBaits 别名包扫描路径，通过该属性可以给包中的类注册别名，注册后在 Mapper 对应的 XML 文件中可以直接使用类名，而不用使用全限定的类名(即 XML 中调用的时候不用包含包名)\r\nmybatis-plus.typeAliasesPackage=com.fank243.cloud.component.domain.entity\r\n\r\n# 枚举类 扫描路径，如果配置了该属性，会将路径下的枚举类进行注入，让实体类字段能够简单快捷的使用枚举属性\r\nmybatis-plus.typeEnumsPackage=com.fank243.cloud.component.domain.enums\r\n\r\n# # 全局默认主键类型，NONE：随机ID，默认值：ASSIGN_ID(雪花算法)\r\nmybatis-plus.global-config.db-configid-type=NONE\r\n\r\n# 表名前缀\r\nmybatis-plus.global-config.table-prefix=tb\r\n\r\n# 逻辑删除字段名称\r\nmybatis-plus.global-configlogic-delete-field=is_deleted \r\n\r\n # 字段验证策略之 insert,在 insert 的时候的字段验证策略\r\nmybatis-plus.global-configinsert-strategy=not_empty\r\n\r\n# 字段验证策略之 update,在 update 的时候的字段验证策略\r\nmybatis-plus.global-configupdate-strategy=not_empty \r\n\r\n# 开启Mybatis二级缓存，默认为 true\r\nmybatis-plus.configuration.cache-enabled=false\r\n', 'c832f393bc3ed731981c3b5dc6271a75', '2021-04-04 23:54:49', '2021-04-04 10:54:49', NULL, '172.18.0.1', 'I', 'b8ffe849-49ed-452f-86df-273cfc8301dc');
INSERT INTO `his_config_info` VALUES (0, 63, 'cloud-auth.properties', 'DEFAULT_GROUP', '', '# 数据源\r\nspring.datasource.druid.driver-class-name=com.mysql.cj.jdbc.Driver\r\nspring.datasource.druid.url=jdbc:mysql://81.71.139.143:8306/cloud-auth\r\nspring.datasource.druid.username=root\r\nspring.datasource.druid.password=ZdyGYHeFlE1TvcOWw0iU', '3a1467cac417c0a430b7f2bbc427a1ab', '2021-04-04 23:54:49', '2021-04-04 10:54:49', NULL, '172.18.0.1', 'I', 'b8ffe849-49ed-452f-86df-273cfc8301dc');
INSERT INTO `his_config_info` VALUES (0, 64, 'cloud-common.properties', 'DEFAULT_GROUP', '', 'spring.main.allow-bean-definition-overriding=true\nspring.autoconfigure.exclude=com.alibaba.druid.spring.boot.autoconfigure.DruidDataSourceAutoConfigure\n\n#请求处理的超时时间\nribbon.ReadTimeout=10000\nribbon.ConnectTimeout=10000\n\n# feign 配置\nfeign.sentinel.enabled=true\nfeign.okhttp.enabled=true\nfeign.httpclient.enabled=false\nfeign.client.config.default.connectTimeout=10000\nfeign.client.config.default.readTimeout=10000\nfeign.compression.request.enabled=true\nfeign.compression.response.enabled=true\n\n# 暴露监控端点\nmanagement.endpoints.web.exposure.include=\'*\'\n', 'b62774df756eb9570ee7960d0ae2e86b', '2021-04-04 23:54:51', '2021-04-04 10:54:49', NULL, '172.18.0.1', 'I', 'b8ffe849-49ed-452f-86df-273cfc8301dc');
